const postList = [
    'post 1',
    'post 2',
    'post 3',
    'post 4',
    'post 5',
    'post 6',
    'post 7',
    'post 8',
    'post 9',
    'post 10'
]

function PostList(){
    return (
        <ul>
            {postList.map((post) => (
                <li>{post}</li>
            ))}
        </ul>
    )
}

export default PostList
